import React from "react";
import { Table } from 'reactstrap';
import styles from './workoutTable.css';


const WorkoutWeekTable = ({workouts}) => {

    const divStyle = {
        backgroundColor: 'red'
    };

    return (
        <Table style={divStyle.backgroundColor}>
            <thead>
            <tr>
                <th>Mo</th>
                <th>Tu</th>
                <th>We</th>
                <th>Th</th>
                <th>Fr</th>
                <th>Sa</th>
                <th>Su</th>
            </tr>
            </thead>
            <tbody>
            <tr>
                {workouts.map(workout => <td key={workout.id}>{workout.name}</td>)}
            </tr>
            </tbody>
        </Table>

    )
}

export default WorkoutWeekTable;


